<h1 mat-dialog-title>Previous Project Found</h1>
<mat-dialog-content>
    Would you like to import data from your last project?
</mat-dialog-content>
<mat-dialog-actions>
    <button type="submit" mat-raised-button [mat-dialog-close]="true">Import</button>
    <button mat-raised-button [mat-dialog-close]="false" color="primary">Don't Import</button>
</mat-dialog-actions>
